// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Work {
    uint salary;

    constructor() {
        salary = 0;
    }

    function doWork(uint x) public {
        salary += 1;
    }

    function pay() public view returns (uint) {
        return salary;
    }
}

